function ProPublicaInfo({ info, photo }) {
    return (
        <div>
            {console.log(info)}
            {info ? (
                <img src={photo} alt="Loaded content" />
            ) : (
                <p>Loading data...</p>  // Or you could use a loading spinner here
            )}
        </div>
    );
}

export default ProPublicaInfo;
